import styled from "styled-components"
import FacebookOutlinedIcon from '@mui/icons-material/FacebookOutlined';
import LinkOutlinedIcon from '@mui/icons-material/LinkOutlined';
import TwitterIcon from '@mui/icons-material/Twitter';
import {Link} from 'react-router-dom'

const Container=styled.div`
height: 130px;

`
const TopWrapper=styled.div`
    width: 70%;
    height: 80px;
    margin: auto;
    display: flex;
`
const Left=styled.div`
 flex: 1;
 display: flex;
 justify-content: center;
 align-items: center;
`
const Logo=styled.div`


`
const Image=styled.img`
    width: 250px;

`

const Center=styled.div`
    flex: 1;
    display: flex;
    justify-content: center;
    align-items: center;

`
const Icon=styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    margin:0 5px;
    padding: 5px;
    color: white;
    background-color:#cecece;
    border-radius: 50%;
`
const Right=styled.div`
    flex: 1;
    display: flex;
    align-items: center;

`
const Option=styled.div`
    padding: 3px 8px;
    border-radius: 3px;
    font-size: 12px;
    background-color: ${props=>props.bg};
    color: ${props=>props.color};
    margin: 0 5px;

`

const BottomWrapper=styled.div`
    border: 1px solid red;
    height: 50px;
    width: 70%;
    margin: auto;
    display: flex;
`
const Nav=styled.div`

`


const Navbar = () => {
  return (
    <Container>
        <TopWrapper>
            <Left>
                <Logo>
                    <Image src="https://www.kindmeal.my/images/logo-kindmeal.png" alt="logo"/>
                </Logo>
            </Left>
            <Center>
                <Icon>
                <LinkOutlinedIcon />
                </Icon>
                <Icon>
                <FacebookOutlinedIcon />
                </Icon>
                <Icon>
                <TwitterIcon />
                </Icon>
            </Center>
            <Right>
                <Option>Login</Option>
                <Option bg="#34619f" color="white">
                    Facebook
                </Option>
                <Option bg="#666666" color="white">
                   Email
                </Option>
                <Option>
                   Sign Up
                </Option>
            </Right>
        </TopWrapper>
        <BottomWrapper>
            <Nav>
                <Link style={{textDecoration:"none",color:"black"}} to={"/"}>Home</Link>
            </Nav>
            <Nav>
                <Link style={{textDecoration:"none",color:"black"}}  to={"/mealdeal"}>Meal Deals</Link>
            </Nav>
            <Nav>
                <Link to={"/kindmoments"}>KindMoments</Link>
            </Nav>
            <Nav>
                <Link to={"/hotpicks"}>Hot Picks</Link>
            </Nav>
            <Nav>
                <Link to={"/recipes"}>Recipes</Link>
            </Nav>
            <Nav>
                <Link to={"/directory"}>Directory</Link>
            </Nav>
            <Nav>
                <Link to={"/article"}>Articles</Link>
            </Nav>
            <Nav>
                <Link to={"/help"}>Help</Link>
            </Nav>
        </BottomWrapper>
    </Container>
  )
}

export default Navbar
